  console.log(initialSubs)
  return (
    <div >
      <Head>
        <title>Subscriptions Tracker App</title>

      </Head>
      <Navbar />

      <main >
        <h1>{initialSubs.map(subscription=><Subscription key={subscription.id} subscription={subscription} />)}</h1>

      </main>


    </div>
  )
}

